script: |
  super -f text -I q11563.spq | sort > q11563.out

inputs:
  - name: q11563.spq
    data: |
      SELECT DISTINCT 94 + - cor0.col1 * - 3 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q11563.out
    data: |
      145
      187
      271
